import React from 'react';
import { Button } from '@/components/ui/button';
import { Card, CardHeader, CardTitle, CardContent, CardFooter } from '@/components/ui/card';
import { CheckCircle } from 'lucide-react';

const ExamDone = ({ onReviewAnswers }) => {
  return (
    <Card className="w-full max-w-md mx-auto">
      <CardHeader>
        <CardTitle className="text-2xl font-bold text-center">Ujian Selesai!</CardTitle>
      </CardHeader>
      <CardContent>
        <div className="flex flex-col items-center space-y-4">
          <CheckCircle size={64} className="text-green-500"/>
          <p className="text-xl font-semibold text-center">Selamat Anda telah meneyelesaikan ujian!</p>
          <p className="text-sm text-gray-500 text-center">Anda telah berhasil meneyelesaikan semua pertanyaan.
          </p>
        </div>
      </CardContent>
      <CardFooter>
        <Button onClick={onReviewAnswers} className="w-full">
          Review Answers
        </Button>
      </CardFooter>
    </Card>
  );
};

export default ExamDone;
